import React, {Component} from 'react'

class MainScreen extends Component {
    render() {
        return (
            <div>
                <div className='options'>
                    <ul>
                        <li><p>Patients</p></li>
                        <li><p>Acquire Patients</p></li>
                    </ul>
                </div>
            </div>
        )
    }   
}

export default MainScreen;
